31.body:
Scanでは簡単にテーブルの内容を（複数件）取得することができます。 後述する Query と比べると大量の RCU を消費するため注意が必要です。 様々なオプションが指定できますが、今回はLimit を指定し、3件取得してみます。 var params = { TableName: 'athlete', Limit: 3, // 3件取得 ReturnConsumedCapacity: 'TOTAL', // 消費したキャパシティユニットも返す
};
dynamodb.scan(params, function(err, data) { if (err) ppJson(err); // an error occurred else ppJson(data); // successful response
});

35.body:
Query - Amazon DynamoDB Query ではパーティションキーを指定し、パーティションキーが一致したすべての項目を取得します。 KeyConditionExpression を指定してパーティションキーを指定する必要があります。 ※ 同様にソートキーの条件も指定することができます。 ここでは、 ID が 5 のデータを取得してみます。 var params = { TableName: 'athlete', KeyConditionExpression: 'ID = :val', // :val のようなプレースホルダが必要 ExpressionAttributeValues: { ":val": 5, // :val の値 }, ScanIndexForward: true, // ソートキーの昇順
};
docClient.query(params, function(err, data) { if (err) ppJson(err); // an error occurred else ppJson(data); // successful response
});

37.body:
athlete テーブルでは ID がパーティションキーであることに注意してください。 例えば、以下のようにパーティションキーを指定しないクエリはエラーとなります。 var params = { TableName: 'athlete', KeyConditionExpression: 'Year = :val', ExpressionAttributeValues: { ":Year": 1994, }, ScanIndexForward: true, };
docClient.query(params, function(err, data) { if (err) ppJson(err); // an error occurred else ppJson(data); // successful response
});

39.body:
GSI を追加するには UpdateTable オペレーションで GlobalSecondaryIndexUpdatesを指定します。 ここでは Year をパーティションキーとしたGSIを追加してみます。 var params = { TableName: "athlete", AttributeDefinitions: [ { AttributeName: "Year", AttributeType: "N" }, { AttributeName: "ID", AttributeType: "N" }, ], GlobalSecondaryIndexUpdates: [ { // GSIを更新 Create: { // 追加 IndexName: "byYear", // 名前をつける KeySchema: [ { AttributeName: "Year", // Year をパーティションキーに設定 KeyType: "HASH", }, { AttributeName: "ID", // ID をソートキーに設定 KeyType: "RANGE", }, ], Projection: { ProjectionType: "ALL", // すべての属性に対して適用 }, ProvisionedThroughput: { ReadCapacityUnits: 1, WriteCapacityUnits: 1, }, }, }, ],
};
dynamodb.updateTable(params, function (err, data) { if (err) ppJson(err); // an error occurred else ppJson(data); // successful response
});

41.body:
追加したGSIを使用してQueryを発行してみましょう。 以下のように IndexName を指定し、特定の Year を持つ項目を取得できます。 ここではYearが1994の項目を取得してみます。 var params = { TableName: "athlete", IndexName: "byYear", // 先ほど追加した GSI KeyConditionExpression: "#y = :year", // Year は予約語のため、 #y に置き換える ExpressionAttributeNames: { "#y": "Year", // #y を Year にマッピング }, ExpressionAttributeValues: { ":year": 1994, }, Limit: 5, // 5件 ScanIndexForward: true, // ID の昇順に取得 ReturnConsumedCapacity: "INDEXES", // セカンダリインデックスの小計も取得
};
docClient.query(params, function (err, data) { if (err) ppJson(err); // an error occurred else ppJson(data); // successful response
}); ここで、ReturnConsumedCapacity: "INDEXES" を指定することでセカンダリインデックスのアクセスも表示することができます。

44.body:
前項ではGSIを追加して特定のYearで検索しましたが、以下のような疑問が湧くのではないでしょうか。 Scan で filter を使えばよいのでは？ 以下のようなScanオペレーションで試してみましょう。 FilterExpression に 前項のKeyConditionExpression と同一の条件を指定しています。 var params = { TableName: "athlete", Limit: 5, // 5 件取得したい FilterExpression: "#y = :year", ExpressionAttributeNames: { "#y": "Year", }, ExpressionAttributeValues: { ":year": { N: "1994" }, }, ReturnConsumedCapacity: "INDEXES",
};
dynamodb.scan(params, function (err, data) { if (err) ppJson(err); // an error occurred else ppJson(data); // successful response
});
